(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0c02f1"],{4164:function(n,e,s){"use strict";s.r(e),e["default"]='---\npageClass: page-reference\n---\n\n# Extensions\n\n<div class="two-up">\n<div class="left">\n\n> The extensions endpoints are used by the Admin App to retrieve what extensions to install. [Learn more about Extensions](/concepts/extensions/).\n\n</div>\n<div class="right">\n\n[[toc]]\n\n</div>\n</div>\n\n---\n\n## List Interfaces\n\nList the available interfaces in the project.\n\n<div class="two-up">\n<div class="left">\n\n### Query Parameters\n\nThis endpoint doesn\'t currently support any query parameters.\n\n### Returns\n\nAn array of interface extension keys.\n\n</div>\n<div class="right">\n\n```\nGET /extensions/interfaces\n```\n\n```json\n// Response\n\n{\n\t"data": ["custom-wysiwyg", "stocks"]\n}\n```\n\n</div>\n</div>\n\n---\n\n## List Displays\n\nList the available displays in the project.\n\n<div class="two-up">\n<div class="left">\n\n### Query Parameters\n\nThis endpoint doesn\'t currently support any query parameters.\n\n### Returns\n\nAn array of display extension keys.\n\n</div>\n<div class="right">\n\n```\nGET /extensions/displays\n```\n\n```json\n// Response\n\n{\n\t"data": ["related-values"]\n}\n```\n\n</div>\n</div>\n\n---\n\n## List Layouts\n\nList the available layouts in the project.\n\n<div class="two-up">\n<div class="left">\n\n### Query Parameters\n\nThis endpoint doesn\'t currently support any query parameters.\n\n### Returns\n\nAn array of layout extension keys.\n\n</div>\n<div class="right">\n\n```\nGET /extensions/layouts\n```\n\n```json\n// Response\n\n{\n\t"data": ["map", "calendar"]\n}\n```\n\n</div>\n</div>\n\n---\n\n## List Modules\n\nList the available modules in the project.\n\n<div class="two-up">\n<div class="left">\n\n### Query Parameters\n\nThis endpoint doesn\'t currently support any query parameters.\n\n### Returns\n\nAn array of module extension keys.\n\n</div>\n<div class="right">\n\n```\nGET /extensions/modules\n```\n\n```json\n// Response\n\n{\n\t"data": ["bookings"]\n}\n```\n\n</div>\n</div>\n\n---\n'}}]);